import React from 'react';
import { Map, Marker, TileLayer } from 'react-leaflet'

function handleClick(num, lat, lon) {
	return () => {
		console.log("You clicked item " + num + ": " + lat + ", " + lon)
	}
}

const LatLongMap = ({center, zoom, position }) => {
	return <Map center={center} zoom={z}>
    	<TileLayer
      		url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      		attribution="&copy; <a href=&quot;http://osm.org/copyright&quot;>OpenStreetMap</a> contributors"
    	/>
    	{position != null ? <Marker position={position}/> :  null}
	</Map>
}

const LatLongList = ({latLongs}) => {
	var num = -1;
	return <table>
		<tbody>
			{latLongs.map(latLong => {
				num = num + 1
				var lat = latLong.latitude
				var lon = latLong.longitude
				return <tr key={lat + "," + lon}>
					<td onClick={handleClick(num, lat, lon)}>{lat + ", " + lon}</td>
				</tr>
				}
			)}
		</tbody>
    </table>
}

const LatLongsComponent = ({latLongs}) => (
    <table>
		<tbody>
			<tr>
				<td><LatLongList latLongs={latLongs}/></td>
				<td><LatLongMap center={[0, 0]} zoom={13} position={[0, 0]}/></td>
			</tr>
		</tbody>
    </table>
  )


export default LatLongsComponent;
